import logo from './logo.svg';
import { useNavigate } from 'react-router-dom';
import './App.css';

function App() {
  const handleNav = () => {
    useNavigate('/mainpage')
  }
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Welcome
        </p>
        <button>
          Press here to enter
        </button>
      </header>
    </div>
  );
}

export default App;


// <a is used to create hyperlinks
